import React from 'react';

const About = () => {
return (
	<div
	style={{
		display: 'flex',
		justifyContent: 'Left',
		alignItems: 'Left',
		height: '100vh'
	}}
	>
	<h1>GeeksforGeeks is a Computer Science portal for geeks.</h1>
	</div>
);
};

export default About;
